#!run
const p=`@hoge1e3/events
@hoge1e3/fs
@hoge1e3/fs-nw
@hoge1e3/rpc
@hoge1e3/default-map
@hoge1e3/counter
@hoge1e3/object-id
@hoge1e3/sfile
@hoge1e3/fs2
@hoge1e3/psync
@hoge1e3/util
@hoge1e3/assert
@hoge1e3/keyset
@hoge1e3/dependencies`.split("\n").map(s=>s+"/");
import {dir} from "@acepad/here";
export async function main(){
    const h=dir(import.meta.url);
    for(let d of h.
    rel("@hoge1e3").listFiles()){
        const r=d.relPath(h);
        if (!p.includes(r)){
            this.echo("x",r);
            this.echo("d",...
                Object.keys(
                d.rel("package.json").
                obj().dependencies||{}));            
        }else{
            this.echo("o",d);
        }
    }
}